import React from 'react'
import CheckAuth from '../functions/checkAuthAdmin';
import { useNavigate } from 'react-router-dom';
import { useEffect } from 'react';

export default function ManageUsers() {
    const navigate = useNavigate();
    useEffect(() => {
        CheckAuth(navigate);
      }, []);
  return (
    <div>ManageUsers</div>
  )
}
